package com.antifraud.entity;

import java.util.Date;
/**
 * 
 *
 * @ClassName: MovingTrack

 * @description 签移动端实地移动轨迹
 *
 * @author lishaozhang
 * @createDate 2018年10月30日
 */
public class MovingTrack {
	
	//主键
    private long id;
    //风控人员id
    private long user_id;
    //终端id
    private long tid;
    //服务id
    private long sid;
    //轨迹id
    private long trid;
    //分控人员姓名
    private String user_name;
    //创建时间
    private Date creat_time;
    //报单编号
    private String report_id;
    //客户姓名
    private String customer_name;
	public MovingTrack() {
		super();
		// TODO Auto-generated constructor stub
	}
	public long getId() {
		return id;
	}
	public void setId(long id) {
		this.id = id;
	}
	public long getUser_id() {
		return user_id;
	}
	public void setUser_id(long user_id) {
		this.user_id = user_id;
	}
	public long getTid() {
		return tid;
	}
	public void setTid(long tid) {
		this.tid = tid;
	}
	public long getSid() {
		return sid;
	}
	public void setSid(long sid) {
		this.sid = sid;
	}
	public long getTrid() {
		return trid;
	}
	public void setTrid(long trid) {
		this.trid = trid;
	}
	public String getUser_name() {
		return user_name;
	}
	public void setUser_name(String user_name) {
		this.user_name = user_name;
	}
	public Date getCreat_time() {
		return creat_time;
	}
	public void setCreat_time(Date creat_time) {
		this.creat_time = creat_time;
	}
	public String getReport_id() {
		return report_id;
	}
	public void setReport_id(String report_id) {
		this.report_id = report_id;
	}
	public String getCustomer_name() {
		return customer_name;
	}
	public void setCustomer_name(String customer_name) {
		this.customer_name = customer_name;
	}
	@Override
	public String toString() {
		return "MovingTrack [id=" + id + ", user_id=" + user_id + ", tid=" + tid + ", sid=" + sid + ", trid=" + trid
				+ ", user_name=" + user_name + ", creat_time=" + creat_time + ", report_id=" + report_id
				+ ", customer_name=" + customer_name + "]";
	}
	
    
    
}
